import { useState } from "react"

const Bloglist = (user) => {
    const [blogs, setBlogs] = useState([])
    
    if (blogs.length < 1) {
        return(
            <div>
                <h1>
                    Blogs
                </h1>
                <p>
                    ´${user.username} logged in´
                </p>
            </div>
        )
    }
}

export default Bloglist;
